import React, { useEffect, useState } from 'react';
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { Header } from '../../components/header/Header';
import { Container, Divider } from '@material-ui/core';
import { useDispatch, useSelector } from 'react-redux';
import { userService } from './../../services/user.service';
import { userActions } from './../../actions/user.actions';
import { menuActions } from '../../actions/menu.action';
import { SideBar } from './SideBar';
import {Creat} from '../../components/createNewRestaurant/create'
const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1
    },
    nonePadding: {
        padding: "0!important"
    }
}));

export function Restaurant(props) {
    const idUser = props.match.params.id;
    const classes = useStyles();
    const userInfo = useSelector(state => state.authentication.user.data);
    const [isFollow, setIsFollow] = useState(false);
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(menuActions.change(-1));
        dispatch(userActions.getInfoUser(idUser));
    }, [isFollow]);
    return (
        <Container>
            <Grid container spacing={3} >
                <Grid item xs={12} className={classes.nonePadding}>
                    <Header></Header>
                </Grid>
                <Grid item xs={3}>
                    <SideBar></SideBar>
                </Grid>
                <Grid item xs={9}>
                </Grid>
            </Grid>
        </Container >
    );
}
